import React from 'react';
import { View, StyleSheet, Text } from 'react-native';

const HomeLocation = () => {
    return (
        <View style={styles.location}>
            <View style={styles.location_heading}>
                <Text style={styles.location_heading_Style}>Our Location</Text>
                <Text style={styles.location_btn_Style}>Show All</Text>
            </View>
            <View style={styles.location_box}>
                <View style={styles.location__box}>
                    <Text>FM 529</Text>
                </View>
                <View>
                    <Text>FM 529</Text>
                </View>
                <View>
                    <Text>FM 529</Text>
                </View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    location: {
        marginTop: '20px',
    },
    location_heading: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        padding: "10px",
        margin: '10px',
    },
    location_heading_Style: {
        color: "#102C56",
        fontSize: '19px',
        lineHeight: "14px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    location_btn_Style: {
        color: "#F98700",
        fontSize: '17px',
        lineHeight: "18px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    // Box
    location_box: {
        flex: 1,
        flexDirection: 'row',
        width: '100%',
        backgroundColor: "#808080",
        justifyContent: 'space-between'
    },
    location__box: {
        width:'102px',
        height:'50px',
        
        padding: '20px',
        backgroundColor: "green"
    }
})

export default HomeLocation;
